import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HelperComponent } from './helper.component';
import { HelperPageComponent } from './helper-page/helper-page.component';
import { CupboardComponent } from 'src/app/cupboard/cupboard.component';

const routes: Routes = [
  {path: '',
  component: HelperComponent,
  children: [{ path: '', redirectTo: '/helper', pathMatch: 'full' },
    {path: '', component: HelperPageComponent},
  { path: 'cupboard', component: CupboardComponent }]}
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class HelperRoutingModule { }
